# Memoization cache for DFS results to avoid recomputing identical subproblems
dfs_memo = {}
vis_poly_memo = {}
def run_exhaustive_dfs(
    # Core state
    current_map: Polygon,
    drones_left_to_place: int,
    current_virtual_path: List[PointT],
    # Static world info
    polygon: Polygon,
    delaunator_data: DelaunatorLike,
    obstructs_func: Callable[[int], bool]
) -> Tuple[float, List[PointT]]:
    """
    Recursively explores ALL valid, connected placement sequences
    with Branch & Bound Pruning and Optimized Geometry.
    """
    global dfs_memo, vis_poly_memo, global_best_score_found

    # --- 0. Memoization Check ---
    map_state_key = (tuple(sorted(current_virtual_path)), round(current_map.area, 2))
    state_key = (map_state_key, drones_left_to_place)
    if state_key in dfs_memo:
        return dfs_memo[state_key]

    # --- 1. BASE CASE ---
    if drones_left_to_place == 0:
        return 0.0, []

    # --- 2. SENSE (Virtual) ---
    # Simplify aggressively for faster frontier finding
    try:
        clean_current_map_for_frontiers = current_map.simplify(TOLERANCE * 5, preserve_topology=True).buffer(0)
    except Exception: # Fallback if cleaning fails
        clean_current_map_for_frontiers = current_map.simplify(TOLERANCE * 5, preserve_topology=True)

    frontiers_geom = get_windows(polygon, clean_current_map_for_frontiers)
    if frontiers_geom.is_empty: return 0.0, []
    tasks_geom = list(frontiers_geom.geoms) if frontiers_geom.geom_type == 'MultiLineString' else [frontiers_geom]
    task_list = [f for f in tasks_geom if f.length > MIN_FRONTIER_LENGTH]
    if not task_list: return 0.0, []

    # --- 3. EXPLORE (Recursive Step) ---
    max_branch_score = -1.0
    best_branch_path = []

    # --- Calculate Immediate Gains & Sort Frontiers (Heuristic Ordering) ---
    frontier_options = []
    # Simplify less aggressively for difference calc, try cleaning
    current_map_clean_for_diff = current_map.simplify(TOLERANCE, preserve_topology=True)
    try: current_map_clean_for_diff = current_map_clean_for_diff.buffer(0)
    except Exception: pass

    max_immediate_gain_this_level = 0.0 # For pruning heuristic

    for frontier in task_list:
        best_gain_on_frontier = -1.0
        best_point_on_frontier = None
        best_view_on_frontier = None # Store the clean view

        sample_t_values = []
        if N_FRONTIER_SAMPLES == 0: sample_t_values = [0.5]
        elif N_FRONTIER_SAMPLES == 1: sample_t_values = [0.0]
        else: sample_t_values = np.linspace(0.0, 1.0, N_FRONTIER_SAMPLES)

        is_any_point_connected = False # Track if *any* sample on this frontier is connectable

        for t in sample_t_values:
            sample_pos = frontier.interpolate(t, normalized=True).coords[0]
            sample_point = Point(sample_pos)

            # --- *** OPTIMIZED CONNECTIVITY CHECK *** ---
            is_connected = False
            for parent_pos in current_virtual_path:
                # Check memoization for parent visibility polygon
                if parent_pos in vis_poly_memo:
                    parent_vis_clean = vis_poly_memo[parent_pos]
                else:
                    # Calculate visibility on demand
                    parent_vis = get_visibility_from_triangulation(parent_pos, delaunator_data, obstructs_func)
                    try: # Clean aggressively for robust 'intersects' check
                        parent_vis_clean = parent_vis.buffer(TOLERANCE * 2).buffer(0)
                    except Exception: parent_vis_clean = Polygon() # Treat as non-visible if cleaning fails
                    vis_poly_memo[parent_pos] = parent_vis_clean # Store in memo

                # Check intersection (more robust than contains with buffer(0))
                if not parent_vis_clean.is_empty and parent_vis_clean.intersects(sample_point.buffer(TOLERANCE)):
                    is_connected = True
                    is_any_point_connected = True # Mark this frontier as potentially viable
                    break # Found a connection

            if not is_connected:
                continue # Skip this *sample point*

            # --- Calculate Gain for Connected Sample Point ---
            view = get_visibility_from_triangulation(sample_pos, delaunator_data, obstructs_func)
            view_clean = view # Use uncleaned first
            gain = 0.0
            try:
                gain = view_clean.difference(current_map_clean_for_diff).area
            except shapely.errors.GEOSException: # REACTIVE CLEANING
                try:
                    view_clean = view.buffer(0) # Clean view
                    # Use the already cleaned map for diff
                    gain = view_clean.difference(current_map_clean_for_diff).area
                except Exception as e_clean:
                    # print(f"  Warning: Difference failed even after cleaning view: {e_clean}") # DEBUG
                    gain = 0.0 # Give up if cleaning also fails

            if gain > best_gain_on_frontier:
                best_gain_on_frontier = gain
                best_point_on_frontier = sample_pos
                best_view_on_frontier = view_clean # Store potentially cleaned view

        # Add this frontier to options if it was connectable and offered gain
        if is_any_point_connected and best_point_on_frontier is not None:
            frontier_options.append((best_gain_on_frontier, best_point_on_frontier, best_view_on_frontier))
            max_immediate_gain_this_level = max(max_immediate_gain_this_level, best_gain_on_frontier)

    # Sort options by immediate gain (descending)
    frontier_options.sort(key=lambda x: x[0], reverse=True)

    # --- Iterate through SORTED options ---
    for immediate_gain, current_best_point, current_best_view in frontier_options:

        # --- *** BRANCH AND BOUND PRUNING (Improved Heuristic) *** ---
        # Use max immediate gain found at this level as estimate for future steps
        optimistic_future_gain_estimate = max_immediate_gain_this_level * (drones_left_to_place - 1) if drones_left_to_place > 1 else 0.0
        potential_total_score = immediate_gain + optimistic_future_gain_estimate

        if potential_total_score < global_best_score_found - 1e-9:
            # print(f"  Pruning Branch! Potential: {potential_total_score:.2f} < Global Best: {global_best_score_found:.2f}") # DEBUG
            continue # Don't explore this branch further
        # --- *** END PRUNING *** ---

        # --- 3b. RECURSE ---
        new_virtual_map = None
        try: # REACTIVE CLEANING for UNION
            # Try union with potentially uncleaned current_map first (faster)
            new_virtual_map = current_map.union(current_best_view)
        except shapely.errors.GEOSException:
            try: # Retry with cleaned inputs if first union failed
                clean_current = current_map.buffer(0)
                # current_best_view should be clean from gain calc, but clean again just in case
                clean_view = current_best_view.buffer(0)
                new_virtual_map = clean_current.union(clean_view)
            except Exception as e_union_clean:
                # print(f"  Warning: Union failed even after cleaning: {e_union_clean}") # DEBUG
                new_virtual_map = None # Mark as failure

        # If union failed completely, cannot proceed down this branch
        if new_virtual_map is None or new_virtual_map.is_empty:
             continue

        new_virtual_path = current_virtual_path + [current_best_point]

        future_gain, future_path = run_exhaustive_dfs(
            new_virtual_map,
            drones_left_to_place - 1,
            new_virtual_path,
            polygon, delaunator_data, obstructs_func
        )

        # --- 3c. Backtrack ---
        total_score_for_this_branch = immediate_gain + future_gain

        if total_score_for_this_branch > max_branch_score:
            max_branch_score = total_score_for_this_branch
            best_branch_path = [current_best_point] + future_path

            # Update global best if a complete path was found
            if drones_left_to_place == 1 and max_branch_score > global_best_score_found:
                 # print(f"  New Global Best Score: {max_branch_score:.2f}") # DEBUG
                 global_best_score_found = max_branch_score

    # --- 4. Memoization Store ---
    result = (max_branch_score if max_branch_score >= 0.0 else 0.0, best_branch_path)
    dfs_memo[state_key] = result
    return result

